import './App.css';
import { RouterProvider, createBrowserRouter } from 'react-router-dom';
import MainBody from './components/MainBody';
import Electronics from './components/Electronics';
import Header from './components/Header';
import Footer from './components/Footer';
import SingleProductPage from './components/SingleProductPage';
import ErrorPage from './components/ErrorPage';
import MenWear from './components/MenWear';
import WomenWear from './components/WomenWear';
import ChildWear from './components/ChildWear';
import Decorations from './components/Decorations';
import Beauty from './components/Beauty';
import SportsEquipment from './components/SportsEquipment';

function App() {
  return (
    <>
      <Header />
      <RouterProvider router={appRouter} />
      <Footer />
    </>
  );
}

const appRouter = createBrowserRouter([
  {
    path: '/',
    element: <MainBody />
  },
  {
    path: '/electronics',
    element: <Electronics />
  },
  {
    path: '/singleproductpage',
    element: <SingleProductPage />
  },
  {
    path: '/electronics',
    element: <Electronics />
  },
  {
    path: '/mens-wear',
    element: <MenWear />
  },
  {
    path: '/women-wear',
    element: <WomenWear />
  },
  {
    path: '/child-wear',
    element: <ChildWear />
  },
  {
    path: '/decorations',
    element: <Decorations />
  },
  {
    path: '/beauty',
    element: <Beauty />
  },
  {
    path: '/sports-equipment',
    element: <SportsEquipment />
  },
  {
    path: '*',
    element: <ErrorPage />
  }
  ,{
    path:'/home'
  }
]
)

export default App;
